import { Component } from "react";
import logo from "./logo.svg";
import "./App.css";

class App extends Component {
  constructor() {
    super();

    this.state = {
      monsters: [
        {
          name: "Linda",
        },
        {
          name: "Frank",
        },
        {
          name: "Jackie",
        },
      ],
    };
  }

  render() {
    return (
      <div className="App">
       {
        this.state.monsters
       }
      </div>
    );
  }
}

export default App;
